import { dataConstants } from "../constants/data_constants";

const { GET_DATA } = dataConstants;

export const dataReducer = (state, action) => {
  switch (action.type) {
    case GET_DATA:
      return {};
    default:
      return state;
  }
};

export const initialData = {
  getData: {},
};
